import React from "react";

const ImageChange = () => {
  return (
    <div>
      <img src="https://i.imgur.com/WomlR1v.jpg" alt="dog-with-mask" />
      &nbsp;&nbsp;&nbsp;
      <img src="" alt="" />
    </div>
  );
};

export default ImageChange;
